import React, { Component } from 'react';
import Pokecard from './Pokecard';
import './pokedex.css';

class Pokedex extends Component {
    static defaultProps = {
        pokemon: [
            { id: 4, name: 'Charmander', type: 'fire', base_experience: 62},
            { id: 7, name: 'Squirtle', type: 'water', base_experience: 63},
            { id: 11, name: 'Metapod', type: 'bug', base_experience: 72},
            { id: 12, name: 'Butterfree', type: 'flying', base_experience: 178},
            { id: 25, name: 'Pikachu', type: 'electric', base_experience: 112},
            { id: 39, name: 'Jigglypuff', type: 'normal', base_experience: 95},
            { id: 94, name: 'Gengar', type: 'poison', base_experience: 225},
            { id: 133, name: 'Eevee', type: 'normal', base_experience: 65}
        ],
        pokemon2: [
            { id: 5, name: 'Charmander', type: 'fire', base_experience: 62},
            { id: 6, name: 'Squirtle', type: 'water', base_experience: 63},
            { id: 7, name: 'Metapod', type: 'bug', base_experience: 72},
            { id: 8, name: 'Butterfree', type: 'flying', base_experience: 178},
            { id: 9, name: 'Pikachu', type: 'electric', base_experience: 112},
            { id: 10, name: 'Jigglypuff', type: 'normal', base_experience: 95},
            { id: 11, name: 'Gengar', type: 'poison', base_experience: 225},
            { id: 12, name: 'Eevee', type: 'normal', base_experience: 65}
        ]
    };

    render() {
        return(
            <div className="Pokedex">
                <h1>HAND ONE</h1>
                <div className="topHand">
                    {this.props.pokemon.map((p) => (
                        <Pokecard id={p.id}/>
                    ))}
                </div>
                <h1>HAND TWO</h1>

                <div className="bottomHand">
                    {this.props.pokemon2.map((p) => (
                        <Pokecard id={p.id} name={p.name} type={p.type} base_experience={p.base_experience}/>
                    ))}
                </div>
            </div>
        )
    }
}

export default Pokedex;
